// src/App.js
import React from 'react';
import Navbar from './components/Navbar';
import Home from './pages/Home';

const App = () => {
  return (
    <div style={styles.container}>
      <Home />
      <Navbar />
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'row-reverse', // 오른쪽에 Navbar 배치
  },
};

export default App;
